INSERT INTO `processes` (`id`, `process_name`, `group_id`, `created_at`, `updated_at`) VALUES
(1, 'Charges hot purified water (85-95 °C) and Starts the Stirrer', 1, '2022-08-08 23:16:07', '2022-08-08 23:16:07'),
(2, 'Adds Cetostearyl Ethoxylate and stirs for 15 minutes.', 1, '2022-08-08 23:16:07', '2022-08-08 23:16:07'),
(3, 'Adds Cetostearyl Alcohol and stirs for 15 minutes.', 1, '2022-08-08 23:16:42', '2022-08-08 23:16:42'),
(5, 'Add simethicone and stir for 45 minuts.', 1, '2022-08-08 23:17:32', '2022-08-08 23:17:32'),
(6, 'Adds Calcium Propiomate, Potassium Sorbate and Sodium Bensoate and Stirs for 45 minutes. Cools it to less than 50 °C.', 111, '2022-08-08 23:17:32', '2022-08-08 23:17:32'),
(7, 'Adds Hydrogen Peroxide and stirs for 30 minutes.', 111, '2022-08-08 23:20:14', '2022-08-08 23:20:14'),
(8, 'Charges Polydimethylsiloxane in the reactor.', 2, '2022-08-08 23:20:14', '2022-08-08 23:20:14'),
(9, 'Heats the material up to 75-85 °C with continuous stirring.', 2, '2022-08-08 23:20:47', '2022-08-08 23:20:47'),
(10, 'Adds Cetostearyl Ethoxylate and stirs for 15 minutes.', 2, '2022-08-08 23:20:47', '2022-08-08 23:20:47'),
(11, 'Adds Cetostearyl Alcohol and stirs for 15 minutes.', 2, '2022-08-08 23:26:00', '2022-08-08 23:26:00'),
(12, 'Adds hot purified water and stir for 45 minutes.', 2, '2022-08-08 23:26:00', '2022-08-08 23:26:00'),
(13, 'Adds Calcium Propiomate, Potassium Sorbate and Sodium Benzoate and Stirs for 10 minutes. Cools it to less than 50 °C.', 2, '2022-08-08 23:26:30', '2022-08-08 23:26:30'),
(14, 'Adds Hydrogen Peroxide and stirs for 30 minutes.', 222, '2022-08-08 23:26:30', '2022-08-08 23:26:30'),
(15, 'Charges Polydimethylsiloxane in reactor.', 3, '2022-08-08 23:27:21', '2022-08-08 23:27:21'),
(16, 'Starts heating the reactor with continuous stirring.', 3, '2022-08-08 23:27:21', '2022-08-08 23:27:21'),
(17, 'When temperature reaches 130-135 °C stops heating the reactor.', 3, '2022-08-08 23:27:57', '2022-08-08 23:27:57'),
(18, 'Stirs for 15 minutes and notes the maximum temperature. Cools it to less than 80 °C.', 3, '2022-08-08 23:27:57', '2022-08-08 23:27:57'),
(19, 'Charge Silicon dioxide (Precipitated Silica) in ribbon blender', 4, '2022-08-08 23:28:31', '2022-08-08 23:28:31'),
(20, 'Charge Dibasic Calcium phosphate in ribbon blender.', 4, '2022-08-08 23:28:31', '2022-08-08 23:28:31'),
(21, 'Start the ribbon blender.', 4, '2022-08-08 23:29:03', '2022-08-08 23:29:03'),
(22, 'Fill the sprayer tank with Simethicone and start the spraying inyo riboon blender continuously.', 4, '2022-08-08 23:29:03', '2022-08-08 23:29:03'),
(23, 'After complete spraying of Simethicone, run the ribbon blender for 35-45 minutes.', 4, '2022-08-08 23:29:24', '2022-08-08 23:29:24'),
(24, 'Charges Precipitated Silica through Diaphram pump.', 6, '2023-02-17 10:33:57', '2023-02-17 10:33:57'),
(25, 'Starts the High speed processor.', 6, '2023-02-17 10:33:57', '2023-02-17 10:33:57'),
(26, 'Charges Simethicone into the High processor and increase the speed at maximum.', 6, '2023-02-17 10:33:57', '2023-02-17 10:33:57'),
(27, 'Charges Dibasic Calcium Phosphate into the High speed processor through the vacuum transfer pump.', 6, '2023-02-17 10:33:57', '2023-02-17 10:33:57'),
(28, 'Mixes for 15 minutes.', 6, '2023-02-17 10:33:57', '2023-02-17 10:33:57'),
(29, 'After thorough mixing for 10-15 minutes The material is transferred through transfer pump, to the Stever at filling area.', 6, '2023-02-17 10:33:57', '2023-02-17 10:33:57'),
(30, 'Finally the matenal is sieved heated and packed in Paper Bags.', 6, '2023-02-17 10:33:57', '2023-02-17 10:33:57'),
(31, 'Charge Polydimethylsiloxane in reactor.', 5, '2023-02-17 10:53:43', '2023-02-17 10:53:43'),
(32, 'Start heating the reactor and start stirring.', 5, '2023-02-17 10:53:43', '2023-02-17 10:53:43'),
(33, 'Once the temperature is between 100- 120°C start the Inline mixer and charge Colloidal Silicon Dioxide (Fumed Silica) in reactor simultaneously and increase stirring speed.', 5, '2023-02-17 10:53:43', '2023-02-17 10:53:43'),
(34, 'When temperature reaches 180-190 °C,\r\nstop heating the reactor.', 5, '2023-02-17 10:53:43', '2023-02-17 10:53:43'),
(35, 'Stop Stirrer and transfer the reaction mass to homogenizing tank No.- ', 5, '2023-02-17 10:53:43', '2023-02-17 10:53:43'),
(36, 'O-Phosphoric acid is added to achive the desired pH', 1, '2023-03-02 14:47:54', '2023-03-02 14:47:54'),
(37, 'O-Phosphoric acid is added to achive the desired pH', 222, '2023-03-02 14:47:54', '2023-03-02 14:47:54');
